import React from 'react'
import Button from '../buttons/button'

const CheckSection = () => {
    return (
        <div className="checkSectionContainer">
            <div className="checkSection-formTitle">
                <h1 className="checkSection-title">Estas listo para Chequear tu producto? </h1>
            </div>

            <div className="checkSection-BtnWrap">
                    <Button
                    btnBG={ '#FAD570' }
                    fontColor={ true }
                    big={ true }
                    fontBig = { false }
                    buttonLabel='Quiero chequear un Producto'
                    // linkedTo={linkedTo}
                    // offSet={-90}
                    >
                    </Button>
                </div>
        </div>
    )   
}

export default CheckSection
